import React, { useState, useEffect } from "react";
import API from "../../utils/API";

function Day() {
  const [currentBooking, setCurrentBooking] = useState(["hi", "hi"]);
  useEffect(() => {
    const date = "2021-05-12";
    API.getBookings(date).then((res) => {
      console.log(res.data);
      setCurrentBooking(res.data);
      log();
    });
  }, []);

  const log = () => {
    console.log(currentBooking);
  };

  return (
    <div>
      {currentBooking.map((booked) => {
        return (
          <tr class="table-info" key={event.id}>
            <th scope="row">{event.title}</th>
            <td>{event.description}</td>
            <td>{event.date}</td>
          </tr>
        );
      })}
      <div key={event.id}>{event.description}</div>
    </div>
  );
}

export default Day;
